(($tx.msie && $tx.msie_ver > 9) || !$tx.msie) &&
(function(){
    var editor;
    module("dropzone", {
        setup: function() {
            editor = Editor;
        }
    });

    var config = Editor.getConfig().canvas.dropZone;
    if (!config || !config.use || config.adaptor) {
        return;
    }

    var getTestImageFile = function() {
        var base64 = 'data:image/jpeg;base64,';
        var data = base64.split(',')[1];
        var type = base64.match(/[a-z]*\/[a-z]*/)[0];

        var binary = atob(data);
        var len = binary.length;
        var buffer = new ArrayBuffer(len);
        var view = new Uint8Array(buffer);
        for (var i = 0; i < len; i++) {
            view[i] = binary.charCodeAt(i);
        }

        var blob = new Blob([view], {type:type});
        blob.name = "test.jpeg";
        return blob;
    };

    var getTestTextFile = function() {
        var blob = new Blob(["Hello"], {type:"text/plain"});
        blob.name = "test.txt";
        blob.size = 5;
        return blob;
    }

    test('get dropzone', function() {
        var dropZone = editor.getDropZone();
        ok(dropZone);
    });

    test('attach two image files & a text file', function(assert) {
        expect(1);

        assi.setContent("<p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>");
        var p = assi.$$('p');
        assi.selectForNodes(p[1].childNodes[0], 0, p[1].childNodes[0], 0);

        var dropZone = editor.getDropZone();
        var files = [getTestImageFile(), getTestTextFile(), getTestImageFile()];

        dropZone.attachFiles(files);

        assi.delayedAssertion(function() {
            if ($tx.msie) {
                htmlEqual(assi.getContent().replace(/img[^>]+/g,'img'), '<p>1</p><p>&nbsp;</p><p><img></p><p></p><p><img></p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>');
            } else {
                htmlEqual(assi.getContent().replace(/img[^>]+/g,'img'), '<p>1</p><p><br></p><p><img></p><p><br></p><p><img></p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>');
            }
        }, 200);
    });


    test('attach 텍스트가 선택 되어 있는 경우', function(assert) {
        expect(1);
        var dropZone = editor.getDropZone();

        assi.setContent("<p>1</p><p>2</p><p>3</p><p>4</p><p>5</p><p>6</p>");
        var p = assi.$$('p');
        assi.selectForNodes(p[1].childNodes[0], 0, p[2].childNodes[0], 1);

        var processor = Editor.canvas.getProcessor();
        processor.savedRange = processor.createGoogRange();

        var files = [getTestImageFile()];

        dropZone.attachFiles(files);

        assi.delayedAssertion(function() {
            if ($tx.msie) {
                htmlEqual(assi.getContent().replace(/img[^>]+/g,'img'), '<p>1</p><p>&nbsp;</p><p><img></p><p>4</p><p>5</p><p>6</p>');
            } else {
                htmlEqual(assi.getContent().replace(/img[^>]+/g,'img'), '<p>1</p><p><br></p><p><img></p><p>4</p><p>5</p><p>6</p>');
            }
        }, 200);

    });
})();